import React, { useState, useEffect } from 'react';
import { Button, Card } from 'react-bootstrap';
import CustomNavbar from '../CostumNavbar';
import { listJobs } from '../Services/JobService';

function JobListing() {
    const [jobs, setJobs] = useState([]);
    const locations = [
        'De√ßan', 'Dragash', 'Drenas', 'Ferizaj', 'Fush√´ Kosov√´', 'Gjakov√´', 'Gjilan', 'Burim',
        'Ka√ßanik', 'Dardan√´', 'Klin√´', 'Lipjan', 'Malishev√´', 'Mitrovic√´', 'Kastriot', 'Pej√´',
        'Besian√´', 'Prishtin√´', 'Prizren', 'Rahovec', 'Skenderaj', 'Suharek√´', 'Sht√´rpc√´', 'Shtime',
        'Viti', 'Vushtrri'
    ];
    const categories = [
        'Administrat√´',
        'Arkitektur√´',
        'Art dhe Kultur√´',
        'Banka',
        'Industria Automobilistike',
        'Retail dhe Distribuim',
        'Nd√´rtimtari & Patundshm√´ri',
        'Mb√´shtetje e Konsumator√´ve, Call Center',
        'Ekonomi, Financ√´, Kontabilitet',
        'Edukim, Shkenc√´ & Hulumtim',
        'Pun√´ t√´ P√´rgjithshme',
        'Burime Njer√´zore',
        'Teknologji e Informacionit',
        'Gazetari, Shtyp & Media',
        'Ligj & Legjislacion',
        'Menaxhment',
        'Marketing, Reklamim & PR',
        'Inxhinieri',
        'Sh√´ndet√´si, Medicin√´',
        'Industri Farmaceutike',
        'Prodhim',
        'Siguri & Mbrojtje',
        'Industri t√´ Sh√´rbimit',
        'Telekomunikim',
        'Tekstil, L√´kur√´, Industri Vesh√´mbathjeje',
        'Menaxhment Ekzekutiv',
        'Gastronomi, Hoteleri, Turiz√´m',
        'P√´rkthim, Interpretim',
        'Transport, Logjistik√´',
        'Industri e P√´rpunimit t√´ Drurit'
    ];

    useEffect(() => {
        fetchJobs();
    }, []);

    const fetchJobs = async () => {
        try {
            const response = await listJobs();
            setJobs(response.data);
        } catch (error) {
            console.error('Error fetching jobs:', error);
        }
    };

    const handleApplyClick = () => {
        // Logic for applying to the job
        console.log('Job page');
    };

    const handleWebpageLink = (url) => {
        window.open(url, '_blank');
    };

    return (
        <>
            <CustomNavbar />
            {/* Search Start */}
            <div className="container-fluid bg-primary py-5">
                <div className="container">
                    <div className="row g-3 justify-content-center align-items-center">
                        <div className="col-md-3">
                            <input type="text" className="form-control" placeholder="Keyword" />
                        </div>
                        <div className="col-md-3">
                            <select className="form-select">
                                <option value="">Industria</option>
                                {categories.map((category, index) => (
                                    <option key={index} value={category}>{category}</option>
                                ))}
                            </select>

                        </div>
                        <div className="col-md-3">
                            <select className="form-select">
                                <option selected>Location</option>
                                {locations.map((location, index) => (
                                    <option key={index} value={location}>{location}</option>
                                ))}
                            </select>
                        </div>
                        <div className="col-md-3">
                            <Button variant="dark" className="w-100" onClick={() => handleApplyClick()}>Search</Button>
                        </div>
                    </div>
                </div>
            </div>
            {/* Search End */}

            {/* Job Listing Start */}
            <div className="container mt-5">
                <div className="row">
                    {jobs.map(job => (
                        <div key={job.id} className="col-md-4 mb-4">
                            <Card>
                                <Card.Body>
                                    <Card.Title>{job.title}</Card.Title>
                                    <Card.Text>
                                        üìç {job.location}<br />
                                        üïí {job.deadline}
                                    </Card.Text>
                                    <Button variant="primary" onClick={handleApplyClick}>Apply</Button>
                                    <Button variant="link" onClick={() => handleWebpageLink(job.url)}>More Info</Button>
                                </Card.Body>
                            </Card>
                        </div>
                    ))}
                </div>
            </div>
            {/* Job Listing End */}
        </>
    );
}

export default JobListing;
